import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  layout: {
    position: 'relative',
    boxSizing: 'border-box',
    minHeight: 'calc(-60px + 100vh)',
  }
})

export default styles
